import React from 'react';

const ToDoList = (props) => {
   
    return( 
    <>
    <div className='todo_style'>
    <i class="fa-solid fa-circle-xmark" onClick={props.onSelect}></i>
    <li>{props.text}</li>;
    </div>
     </>
    )
};
export default ToDoList;
